 "title": "Cómo llegué a ser CTO en tres historias - Platzi",
 "description": "\"Aprende a delegar en vez de hacerlo todo. Hay gente mejor que tu\" : Federico Soria. \n\nFederico Soria (@fedesoria), CTO de Pay By Group, te cuenta tres increíbles historias: participó en la obtención de un récord Guinness, su experiencia en una pizzería y cómo el aprendizaje de estas dos lo llevaron a trabajar en Silicon Valley, el ambiente laboral tecnológico más competitivo y exigente del mundo.\n\n---------------------------------------------------------------------\nTodo esto y más, en http://platzi.com\n\n\n\n¡Suscríbete a nosotros!\nTwitter: http://twitter.com/platzi\nFacebook: http://bit.ly/platzifb\nAquí, en YouTube: http://bit.ly/mejoryt\n\n------------------------------------------------------------------------\n\nCTO\n\n¿Que es un CTO?, ¿Como llegar a ser un CTO?, ¿Como puedo ser un buen CTO?.\n\nEl director de tecnología (chief technical officer o chief technology officer, abreviado como CTO) es una posición ejecutiva dentro de una organización en el que la persona que ostenta el título se concentra en asuntos tecnológicos y científicos. A menudo, el CTO es líder de un grupo técnico en una compañía, particularmente construyendo productos o creando servicios que dan cuerpo a tecnologías específicas de la industria. En algunos casos el CTO además maneja el trabajo de investigación y desarrollo en las organizaciones.\n\n----------------------------------------------------------------------\n\nCurso de Ruby on Rails: http://bit.ly/CursoRubyOnRails\nCurso de Estrategia Digital: http://bit.ly/CursoEstrategiaDigital",
